import React from "react";
import Card from "./Card";
import Footer from "./Footer";
import contacts from "../content";
import Nav from "./Nav";

function createCard(contacts) {
  return (
    <Card
      key={contacts.id}
      id={contacts.id}
      name={contacts.name}
      img={contacts.imgURL}
    />
  );
}

function App() {
  return (
    <div>
      <Nav />
      <dl className="dictionary">{contacts.map(createCard)}</dl>
      <Footer />
    </div>
  );
}

export default App;
